script: |
  super -f text -I q3332.spq | sort > q3332.out

inputs:
  - name: q3332.spq
    data: |
      SELECT + col1 * col0 AS col0, + col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL IN ( + col1, ( + col1 ) * + 67 * col1 + + col2, + - 18 - 42 );
  - name: tab2

outputs:
  - name: q3332.out
    data: |
